---
import type { DateTimeInput as Props } from "../../../../types";
import mapDataset from "../../../utilities/mapDataset";

const {
	cssClasses = [],
	dataset,
	form,
	id,
	name,
	type,
	...attrs
} = Astro.props;

const css = ["sb-datetime-input", ...cssClasses].join(" ");
const data = mapDataset(dataset);
---

<span>
	<input
		{...attrs}
		aria-labelledby={`${id}_label`}
		aria-describedby={`${id}_help`}
		class={css}
		{...data}
		id={id}
		form={form}
		name={name}
		type={type}
	/>
</span>
